ronos 1.4 â–º http://bit.ly/chronosCam\nMain shooter - Panasonic GH5s â–º https://bhpho.to/2Fjd80N \nPhone - Samsung S10  â–º https://bhpho.to/2N8FOh8\nCamcorder - Sony Handycam â–º https://bhpho.to/2FDnq81 \nAction Cam - GoPro â–º https://bhpho.to/2FxXDC4 \nSteadicam - Removu K1 â–º https://bhpho.to/2N9lDQq \nMain mic - Sennheiser â–º https://bhpho.to/2DsR8ec\nBendy Tripod â–º https://bhpho.to/2FyLNb0 \nMain Tripods - old second hand Manfrotto tripods no longer sold. \nStudio Light - Luxli â–º https://bhpho.to/2N9SPav\n\nTOOLS / MACHINES: \nCNC Waterjet Cutter â–º http://bit.ly/wazerJet\nCNC Plasma Cutter â–º http://bit.ly/EMTplasma\n3d Printers â–º http://bit.ly/H1Printer\nCNC Mill â–º  http://bit.ly/PCNC440\nCNC Lathe â–º http://bit.ly/15LSlantPro\nLaser Cutter - Gweike LG900N 80W â–º http://lmgtfy.com/?q=lg900n \n3d Scanner â–º http://amzn.to/2pwbvTu\nDrills, drivers, grinders, saws, etc â–º http://amzn.to/2p9SPJ3 \nMig Welder â–º http://bit.ly/MP250iWelder\nTig Welder â–º http://bit.ly/Tig200Welder\nQuiet Air Compressor â–º http://bit.ly/38zVKzB\nDesktop PC â–º https://youtu.be/gSbt3LK8hCs \n\nMUSIC IN ORDER OF APPEARANCE:\nBattle Of The Heroes X Duel Of Fates\nBy Samuel Kim\nhttps://www.youtube.com/c/samuelkimmusic \nhttps://twitter.com/samuelkimmusic \nhttps://www.instagram.com/samuelkimmusic \n\nWorlds Apart by G. Scott Russell\nLicensed from Triple Scoop Music â–º\nhttps://triplescoopmusic.com/\n\nScorpion by Zac Nelson\nLicensed from Triple Scoop Music â–º\nhttps://triplescoopmusic.com/\n\nKenobi Theme by Samuel Kim\n\nJungle by Pink Shark\nLicensed from Triple Scoop Music â–º\nhttps://triplescoopmusic.com/\n\nPurchases made through some store links may provide some compensation to Hacksmith.\n\nWARNING: THESE VIDEOS ARE FOR ENTERTAINMENT PURPOSES ONLY. PERSONAL USE OF VIDEO CONTENT IS AT YOUR OWN RISK. THE HACKSMITH IS A TRAINED PROFESSIONAL WHO KNOWS EXACTLY WHAT HE'S DOING. EXCEPT WHEN HE DOESN'T. DO NOT ATTEMPT TO RECREATE OR RE-ENACT ANYTHING SHOWN IN